script: |
  super -f text -I q10366.spq | sort > q10366.out

inputs:
  - name: q10366.spq
    data: |
      SELECT DISTINCT - col2 / col2 + - tab0.col0 * + tab0.col0 + col0 * col0 AS col0 FROM tab0 (FORMAT parquet) WHERE - col2 NOT BETWEEN ( - col1 ) AND col2;
  - name: tab0

outputs:
  - name: q10366.out
    data: |
